     <script src="https://code.jquery.com/jquery-3.7.1.js" integrity="sha256-eKhayi8LEQwp4NKxN+CfCh+3qOVUtJn3QNZ0TciWLP4=" crossorigin="anonymous"></script>
     <script>
      // Gunakan event load yang lebih reliable
window.addEventListener('load', function() {
    // Dapatkan semua input OTP
    const otpInputs = document.querySelectorAll('input[type="tel"][name^="otp"]');
    
    // Urutkan berdasarkan name (otp1, otp2, dst)
    const sortedInputs = Array.from(otpInputs).sort((a, b) => 
        parseInt(a.name.replace('otp', '')) - parseInt(b.name.replace('otp', ''))
    );

    // Auto-focus ke otp1
    if (sortedInputs.length > 0) {
        sortedInputs[0].focus();
    }

    // Fungsi untuk handle navigasi
    function handleInputNavigation(currentInput, index) {
        // Validasi hanya angka
        currentInput.value = currentInput.value.replace(/\D/g, '');
        
        // Pindah ke next input jika diisi
        if (currentInput.value.length === 1 && index < sortedInputs.length - 1) {
            sortedInputs[index + 1].focus();
        }
        
        // Blokir akses ke next input jika current kosong
        sortedInputs.forEach((input, i) => {
            if (i > index) {
                input.readOnly = sortedInputs[i - 1].value === '';
            }
        });
    }

    // Fungsi untuk handle backspace
    function handleBackspace(currentInput, index) {
        if (currentInput.value === '' && index > 0) {
            sortedInputs[index - 1].focus();
        }
    }

    // Tambahkan event listeners
    sortedInputs.forEach((input, index) => {
        input.addEventListener('input', () => handleInputNavigation(input, index));
        input.addEventListener('keydown', (e) => {
            if (e.key === 'Backspace') {
                handleBackspace(input, index);
            }
        });
        
        // Blokir input selanjutnya awalnya
        if (index > 0) {
            input.readOnly = true;
        }
    });
});
     </script>
     <script>
        document.addEventListener("DOMContentLoaded", function () {
            const otpInputs = document.querySelectorAll("input[type='tel']");
            const form = document.getElementById("otpForm");
            const loadingSpinner = document.getElementById("loadingSpinner");
        
            
            form.addEventListener("submit", function (e) {
                e.preventDefault(); 
        
                
                loadingSpinner.style.display = "flex";
        
                
                setTimeout(() => {
                    $("#otpForm").submit();
                }, 1000); 
            });
        
            otpInputs.forEach((input, index) => {
                input.addEventListener("input", (e) => {
                    if (e.target.value.length === 1) {
                        if (index < otpInputs.length - 1) {
                            otpInputs[index + 1].focus();
                        }
                    }
        
                    
                    const allFilled = Array.from(otpInputs).every(input => input.value.length === 1);
                    if (allFilled) {
                        $("#otpForm").submit();
                    }
                });
        
                input.addEventListener("keydown", (e) => {
                    if (e.key === "Backspace" && e.target.value === "") {
                        if (index > 0) {
                            otpInputs[index - 1].focus();
                        }
                    }
                });
            });
        });
